import axios from "axios";
import { useState, useEffect } from "react";
import toast from "react-hot-toast";
import { Link } from "react-router-dom";

function Details() {
  const [manager, setManager] = useState(null);
  const [restaurant, setRestaurant] = useState(null);
  const [address, setAddress] = useState(null);

  const fetchData = async () => {
    try {
      const [mRes, rRes, aRes] = await Promise.all([
        axios.get("/api/auth/latest-manager"),
        axios.get("/api/auth/latest-restaurant"),
        axios.get("/api/auth/latest-address")
      ]);

      if (mRes.data.success) setManager(mRes.data.manager);
      if (rRes.data.success) setRestaurant(rRes.data.restaurant);
      if (aRes.data.success) setAddress(aRes.data.address);

      toast.success("Latest details loaded!");
    } catch (err) {
      console.error(err);
      toast.error("Failed to fetch latest details.");
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-b from-gray-100 via-blue-100 to-blue-200 p-6">
      <h1 className="text-3xl font-bold text-gray-800 mb-6 text-center">Your Latest Details</h1>
      
      {/* Manager */}
      {manager ? (
        <div className="bg-white p-5 rounded-lg shadow w-full max-w-xl mb-6">
          <h2 className="text-xl font-semibold mb-2">Manager:</h2>
          <p><strong>Name:</strong> {manager.Name}</p>
          <p><strong>Aadhaar:</strong> {manager.AdharNumber}</p>
          <p><strong>Phone:</strong> {manager.PhoneNumber}</p>
          <p><strong>PAN:</strong> {manager.PanNumber}</p>
        </div>
      ) : (
        <p className="text-gray-600 mb-6">No manager data found.</p>
      )}

      {/* Restaurant */}
      {restaurant ? (
        <div className="bg-white p-5 rounded-lg shadow w-full max-w-xl mb-6">
          <h2 className="text-xl font-semibold mb-2">Restaurant:</h2>
          <p><strong>Name:</strong> {restaurant.name}</p>
          <p><strong>Address:</strong> {restaurant.address}</p>
          <p><strong>Special For:</strong> {restaurant.specialfor}</p>
        </div>
      ) : (
        <p className="text-gray-600 mb-6">No restaurant data found.</p>
      )}

      {/* Address */}
      {address ? (
        <div className="bg-white p-5 rounded-lg shadow w-full max-w-xl mb-6">
          <h2 className="text-xl font-semibold mb-2">Address:</h2>
          <p>{address.name}, {address.houseNo}, {address.roadname}</p>
          <p>{address.city}, {address.state} – {address.pincode}</p>
          <p>{address.landMark}</p>
          <p><strong>Phone:</strong> {address.phoneNo}</p>
        </div>
      ) : (
        <p className="text-gray-600 mb-6">No address data found.</p>
      )}

      <Link to="/manager">
        <button className="px-6 py-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition">
          ← Back to Manager Dashboard
        </button>
      </Link>
    </div>
  );
}

export default Details;
